import React from 'react';
import './Home.css';

const Home = ({ theme }) => {
  return (
    <div className={`home-page ${theme.toLowerCase()}`}>
      <h1 data-aos="fade-up">Welcome to TechSaaS Vision</h1>
      {theme === 'Mafia' && (
        <p data-aos="fade-left" className="mafia-theme">
          We make offers your customers canâ€™t refuse.
        </p>
      )}
      {theme === 'Drug Game' && (
        <p data-aos="fade-right" className="drug-game-theme">
          We're the plug for your digital needs.
        </p>
      )}
      {theme === 'Adult Entertainment' && (
        <p data-aos="fade-left" className="adult-theme">
          We keep your audience coming back for more.
        </p>
      )}
      {theme === 'Monopoly' && (
        <p data-aos="fade-right" className="monopoly-theme">
          Helping you pass Go and dominate the board.
        </p>
      )}
      {theme === 'Foodie Influencer' && (
        <p data-aos="fade-left" className="foodie-theme">
          Serving up digital solutions that leave your audience hungry
          for more.
        </p>
      )}
      {theme === 'Social Media Influencer' && (
        <p data-aos="fade-right" className="social-influencer-theme">
          Get ready to go viral with our digital solutions.
        </p>
      )}
    </div>
  );
};

export default Home;
